import PropTypes from 'prop-types'

const MenuItems = ({title,active,onClick}) => {
    return (
        <li>
            <a onClick={()=>{
                onClick(title)
            }} className={"block cursor-pointer border-0 py-2 pr-4 pl-3 $(active ? text-blue-700`: 'text-gray-400') hover:text-sky-700"} >
                {title}
            </a>
        </li>
    )
}

MenuItems.propTypes = {
    title: PropTypes.string,
    active: PropTypes.bool,
    onclick:PropTypes.func
}

MenuItems.defaultProps = {
    title: "CORONA APP",
    active: false,
    onClick:()=>null
}


export default MenuItems;
